import React from "react";
import EventCard from "./EventCard";

const Event = () => {
  return (
    <div className="mt-5 px-5 flex flex-wrap gap-4">
      {[1, 1, 1, 1].map((item) => (
        <EventCard />
      ))}
    </div>
  );
};

export default Event;
